import React from "react";
import PlacesCard from "./PlacesCard";
import {
  Box,
  Typography,
  Button,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Chip,
  Grid,
} from "@material-ui/core";

const PlacesContainer = () => {
  return (
    <div>
      <Typography gutterBottom variant="h5">
        Name
      </Typography>
      <Grid container>
        <PlacesCard />
      </Grid>
    </div>
  );
};

export default PlacesContainer;
